// DevNet spins up a network of three nodes running on localhost.
// One node is configured as a buyer, one as a vendor, and one as a
// moderator. It uses mock coins which are loaded into the wallets
// of each node.
type DevNet struct{}

// Execute starts the localnet.
func (x *DevNet) Execute(args []string) error {

	// Create buyer, vendor, and moderator nodes
	buyerCfg := newConfig("buyer", "/ip4/127.0.0.1/tcp/4006", "/ip4/127.0.0.1/tcp/4003")
	buyer, err := core.NewNode(context.Background(), buyerCfg)
	if err != nil {
		return err
	}

	vendorCfg := newConfig("vendor", "/ip4/127.0.0.1/tcp/4007", "/ip4/127.0.0.1/tcp/4004")
	vendorCfg.BoostrapAddrs = []string{fmt.Sprintf("%s/p2p/%s", buyerCfg.SwarmAddrs[0], buyer.Identity().Pretty())}
	vendor, err := core.NewNode(context.Background(), vendorCfg)
	if err != nil {
		return err
	}

	moderatorCfg := newConfig("moderator", "/ip4/127.0.0.1/tcp/4008", "/ip4/127.0.0.1/tcp/4005")
	moderatorCfg.BoostrapAddrs = []string{fmt.Sprintf("%s/p2p/%s", buyerCfg.SwarmAddrs[0], buyer.Identity().Pretty())}
	moderator, err := core.NewNode(context.Background(), moderatorCfg)
	if err != nil {
		return err
	}

	// Build the mock wallet network and set the mock wallet in each node.
	walletNet := wallet.NewMockWalletNetwork(3)
	buyer.Multiwallet()[iwallet.CtMock] = walletNet.Wallets()[0]
	vendor.Multiwallet()[iwallet.CtMock] = walletNet.Wallets()[1]
	moderator.Multiwallet()[iwallet.CtMock] = walletNet.Wallets()[2]

	walletNet.Wallets()[0].SetEventBus(buyer.EventBus())
	walletNet.Wallets()[1].SetEventBus(vendor.EventBus())
	walletNet.Wallets()[2].SetEventBus(moderator.EventBus())

	if err := core.InitializeMultiwallet(buyer.Multiwallet(), buyer.DB(), time.Now()); err != nil {
		return err
	}
	if err := core.InitializeMultiwallet(vendor.Multiwallet(), vendor.DB(), time.Now()); err != nil {
		return err
	}
	if err := core.InitializeMultiwallet(moderator.Multiwallet(), moderator.DB(), time.Now()); err != nil {
		return err
	}

	walletNet.Start()
	buyer.Start()
	vendor.Start()
	moderator.Start()

	// Generate some mock coins and send them to each party
	buyerAddr, err := walletNet.Wallets()[0].CurrentAddress()
	if err != nil {
		return err
	}
	vendorAddr, err := walletNet.Wallets()[1].CurrentAddress()
	if err != nil {
		return err
	}
	moderatorAddr, err := walletNet.Wallets()[2].CurrentAddress()
	if err != nil {
		return err
	}
	if err := walletNet.GenerateToAddress(buyerAddr, iwallet.NewAmount(10000000)); err != nil {
		return err
	}
	if err := walletNet.GenerateToAddress(vendorAddr, iwallet.NewAmount(10000000)); err != nil {
		return err
	}
	if err := walletNet.GenerateToAddress(moderatorAddr, iwallet.NewAmount(10000000)); err != nil {
		return err
	}
	walletNet.GenerateBlock()

	if err := setupBuyer(buyer); err != nil {
		return err
	}
	if err := setupModerator(moderator); err != nil {
		return err
	}
	if err := setupVendor(vendor, moderator.Identity()); err != nil {
		return err
	}

	// Set up a ticker to generate mock blocks once every minute.
	ctx, cancel := context.WithCancel(context.Background())
	go func() {
		ticker := time.NewTicker(time.Minute)
		for {
			select {
			case <-ticker.C:
				walletNet.GenerateBlock()
			case <-ctx.Done():
				ticker.Stop()
				return
			}
		}
	}()

	c := make(chan os.Signal, 1)
	signal.Notify(c, os.Interrupt, os.Kill)
	for sig := range c {
		if sig == os.Kill {
			log.Info("Devnet killed")
			os.Exit(1)
		}
		cancel()
		walletNet.Stop()
		buyer.Stop(true)
		vendor.Stop(true)
		moderator.Stop(true)
		log.Info("Devnet stopped")
		os.Exit(1)
	}
	return nil
}

func newConfig(role, gatwayAddr, swarmAddr string) *repo.Config {
	return &repo.Config{
		DataDir:           path.Join(repo.DefaultHomeDir, "devnet", role),
		GatewayAddr:       gatwayAddr,
		SwarmAddrs:        []string{swarmAddr},
		Testnet:           true,
		BoostrapAddrs:     nil,
		DisableNATPortMap: true,
		IPNSQuorum:        2,
		LogLevel:          "info",
	}
}

func setupBuyer(n *core.OpenBazaarNode) error {
	if _, err := n.GetMyProfile(); errors.Is(err, coreiface.ErrNotFound) {
		avatar := ``
		avatarHashes, err := n.SetAvatarImage(avatar, nil)
		if err != nil {
			return err
		}
		header := ``
		headerHashes, err := n.SetAvatarImage(header, nil)
		if err != nil {
			return err
		}

		return n.SetProfile(&models.Profile{
			Name:             "Buyer Bob",
			ShortDescription: "I am a devnet buyer",
			About:            "I'm Buyer Bob. I help testing on devnet by buying things.",
			Location:         "Palo Alto",
			AvatarHashes:     avatarHashes,
			HeaderHashes:     headerHashes,
		}, nil)
	}
	return nil
}

func setupVendor(n *core.OpenBazaarNode, moderatorID peer.ID) error {
	if _, err := n.GetMyProfile(); errors.Is(err, coreiface.ErrNotFound) {
		avatar := ``
		avatarHashes, err := n.SetAvatarImage(avatar, nil)
		if err != nil {
			return err
		}
		header := ``
		headerHashes, err := n.SetAvatarImage(header, nil)
		if err != nil {
			return err
		}

		err = n.SetProfile(&models.Profile{
			Name:             "Vendor Vicky",
			ShortDescription: "I am a devnet vendor",
			About:            "I'm Vendor Vicky. I help testing on devnet by selling things.",
			Location:         "New York",
			AvatarHashes:     avatarHashes,
			HeaderHashes:     headerHashes,
			Vendor:           true,
		}, nil)
		if err != nil {
			return err
		}
	}

	listings, err := n.GetMyListings()
	if err != nil {
		return err
	}

	if len(listings) == 0 {
		physicalImage := ``
		physicalImageHashes, err := n.SetProductImage(physicalImage, "swanson-shirt.jpg")
		if err != nil {
			return err
		}
		physicalListing := factory.NewPhysicalListing("ron-swanson-tshirt")
		physicalListing.Item.Images = []*pb.Listing_Item_Image{
			{
				Original: physicalImageHashes.Original,
				Tiny:     physicalImageHashes.Tiny,
				Small:    physicalImageHashes.Small,
				Medium:   physicalImageHashes.Medium,
				Large:    physicalImageHashes.Large,
				Filename: physicalImageHashes.Filename,
			},
		}
		if err := n.SaveListing(physicalListing, nil); err != nil {
			return err
		}
		digitalImage := ``
		digitalImageHashes, err := n.SetProductImage(digitalImage, "swanson-photo.jpg")
		if err != nil {
			return err
		}
		digitalListing := factory.NewPhysicalListing("ron-swanson-image")
		digitalListing.Item.Images = []*pb.Listing_Item_Image{
			{
				Original: digitalImageHashes.Original,
				Tiny:     digitalImageHashes.Tiny,
				Small:    digitalImageHashes.Small,
				Medium:   digitalImageHashes.Medium,
				Large:    digitalImageHashes.Large,
				Filename: digitalImageHashes.Filename,
			},
		}
		if err := n.SaveListing(digitalListing, nil); err != nil {
			return err
		}

		if err = n.SetModeratorsOnListings([]peer.ID{moderatorID}, nil); err != nil {
			return err
		}
	}
	return nil
}

func setupModerator(n *core.OpenBazaarNode) error {
	if _, err := n.GetMyProfile(); errors.Is(err, coreiface.ErrNotFound) {
		avatar := ``
		avatarHashes, err := n.SetAvatarImage(avatar, nil)
		if err != nil {
			return err
		}
		header := ``
		headerHashes, err := n.SetAvatarImage(header, nil)
		if err != nil {
			return err
		}

		err = n.SetProfile(&models.Profile{
			Name:             "Moderator Mike",
			ShortDescription: "I am a devnet moderator",
			About:            "I'm Moderator Mike. I help testing on devnet by moderating orders.",
			Location:         "Tokyo",
			AvatarHashes:     avatarHashes,
			HeaderHashes:     headerHashes,
		}, nil)
		if err != nil {
			return err
		}

		return n.SetSelfAsModerator(context.TODO(), &models.ModeratorInfo{
			Description:        "I will moderated anything any everything.",
			TermsAndConditions: "I take a 10% fee.",
			Languages:          []string{"English"},
			Fee: models.ModeratorFee{
				FeeType:    models.PercentageFee,
				Percentage: 10,
			},
		}, nil)
	}
	return nil
}
